function Message(props) {
    return (
        <div className="card bg-dark text-dark mb-2">
            <div className="card-img-overlay">
                <h5 className="card-title">{props.message.name}</h5>
            </div>
            <img className="card-img" src={"http://localhost:3001/message/" + props.message.id} alt={props.message.name}/>
        </div>
    )
}
export default Message;
